function Pagination({ total, record ,update}) {

    let n = Math.ceil(total / record)

    let page = []

    for (let i = 1; i <= n; i++) {
        page.push(i)
    }
    return (

        <div>
            <ul className="pagination">
                {page.map((item) => (
                    <li className="page-item">
                        <a href="#" className="page-link" onClick={update}>{item}</a>
                    </li>
                ))}
            </ul>


        </div>
    )
}
export default Pagination;
